Elexis Monroe, T. Stone, Angie Noir, Kimber Woods, Desi Dalton, Tony D., Carmen Valentina, Russell Grand, Monica Santos, John E. Bravo, Kandie St. Andrews, Jodi West

Watch the story unfold as Elexis Monroe unknowingly inherits a partnership in a swinger hotel. Her new partner, her dead husband's Ex-Wife Jodi West, wants nothing to do with her. Go along with her as she makes the journey from innocence to full immersion into the swinger lifestyle! Shot on location at the actual swinger hotel, Secrets Hideaway in Central Florida
